export class TokenService {
    private _token: string | null = null;
    private _name: string | null = null;
  
    // ...
  
    public set name(value: string | null) {
      this._name = value;
    }
  
    public get name(): string | null {
      return this._name;
    }
    setToken(token: string) {
    this._token = token;
  }

  getToken() {
    return this._token;
  }
  
    // ...
  }
